          "title": "It's the Matrixbut for locusts.",
          "description": "At the Department of Collective Behaviour, part of the Max Planck Institute of Animal Behavior, researchers are putting locusts into simulated worlds, both virtual and physical, in the hope that they can figure out how devastating swarms form and move. â–  About the Centre: https://www.exc.uni-konstanz.de/collective-behaviour/ https://www.ab.mpg.de/couzin\n\nEdited by Michelle Martin https://twitter.com/mrsmmartin\nThanks to David Walter for the suggestion\n\nThis is the most uncomfortable I've ever felt while filming, for a few reasons. First, of course, because of the locust swarm itself. Second, because animal research â€” even on creatures as simple and pestilent as locusts â€” always raises ethical questions. Now, the researchers are careful with the locusts, and I don't think many people could have a problem with this. Indeed, most of the world currently has zero ethical restrictions on insect experimentation â€” but it's still worth interrogating whether this is okay. And finally: because if we can do this so easily to less intelligent creatures... what's to stop something more intelligent coming along and doing the same to us?\n\nI'm at https://tomscott.com\r\non Twitter at https://twitter.com/tomscott\r\non Facebook at https://facebook.com/tomscott\r\nand on Instagram as tomscottgo"
        }
